import React from 'react';
import style from './Post.module.css';
function Post() {
  return (
    <div className={style.main}>
      <div className={style.name}>
        Janice Griffith
        <img
          className={style.image}
          src="http://www.wpkixx.com/html/winku-dark/images/resources/user-post.jpg"
          alt="my image"
        />
        <div className={style.description}></div>
      </div>
      <div className={style.post_like}>
        <div className={style.like}>Like</div>
        <div className={style.comments}>Comments</div>
        <div className={style.reposts}>Reposts</div>
      </div>
    </div>
  );
}

export default Post;
